% Detect outliers using the IQR method
Q1 = prctile(data,25);
Q3 = prctile(data,75);
IQR = Q3 - Q1;
lower_bound = Q1 - 1.5*IQR;
upper_bound = Q3 + 1.5*IQR;
outliers_iqr = data(data < lower_bound | data > upper_bound);

% Detect outliers using the Z method
mean_data = mean(data);
std_data = std(data);
z_scores = (data - mean_data) / std_data;
threshold = 3; % set a threshold of 3 standard deviations
outliers_z = data(abs(z_scores) > threshold);

% Print the results
disp(['IQR outliers: ' num2str(outliers_iqr')]);
disp(['Z outliers: ' num2str(outliers_z')]);
